import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import './MessageForm.css';

const MessageForm = () => {
  return (
    <form className="message-box">
      <input id="message" type="text" className="message-box__input"/>
      <button className="message-box__send" type="submit">
        <FontAwesomeIcon icon={['fas', 'fa', 'paper-plane']}></FontAwesomeIcon>
      </button>
    </form>);
};

export default MessageForm;
